window.bookSummaryJSON = "<p><b>Five sexy, passionate, MM sports romances in one collection for the first time! Indulge in the Winner Takes All Collection from #1 New York Times Bestselling author Lauren Blakely writing MM romance as L. Blakely…</b></p> <p><b>The Boyfriend Comeback…</b></p> <p>Some men are just off-limits. Like, say, all the other football players in the league….</p> <p>I have to stop replaying the one night I spent with my rival. Trouble is, that white-hot encounter with the other quarterback answered a lot of questions I’ve had about myself, but it also led me into this mess where he hates me…</p> <p><b>Turn Me On…</b></p> <p>The first rule of being an attorney is don’t sleep with your clients.</p> <p>The second rule is–see the first rule.</p> <p>Those guidelines don’t account for a man like Zane Archer though…</p> <p><b>A Very Filthy Game…</b></p> <p>When the British billionaire wants to teach the cocky athlete a brand new kind of game…</p> <p>Lately, I’ve been full of questions. One hot summer night, I find all the answers when I kiss another guy for the first time. But he disappears, leaving me wondering who my mystery man was.</p> <p><b>Limited Edition Husband…</b></p> <p>One night with no strings was supposed to be the plan.</p> <p>I stick to that strategy when I bump into a charming Brit I met once before. He’s newly out and eager for <i>all the things he’s never done</i>, so I make the helpful suggestion we jet off to the city of sin for the night, then say goodbye.</p> <p>But instead, thanks to a bet and some bourbon, we’re saying <i>I do</i>…</p> <p><b>Manhandled…</b></p> <p>I didn’t plan to bid big on a date with my baseball player best friend at the auction. But he looked really good in that tailored suit, and I can't resist a dare.</p> <p>The media jumps all over the story–<i>the city’s new quarterback nabs a date with the bigshot star shortstop.</i></p>"; 
